import React, { useEffect, useRef, useState } from 'react'

const Map = props => {

  const mapRef = useRef(null)

  let map
  const initMap = () => {
    map = new google.maps.Map(document.getElementById('map'), {
      center: {lat: -34.397, lng: 150.644},
      zoom: 8
    });
  }

  return (
    <div id="map" ref={mapRef}></div>
  )
}

export default Map
